const input = $input.first().json;
const booking = input.body?.payload || input.payload || input;

// Extract attendee info
const attendee = booking.attendees?.[0] || {};

// Parse the call datetime
const callDatetime = new Date(booking.startTime);

return [{
  json: {
    // Lead info
    name: attendee.name || booking.responses?.name?.value || 'Unknown',
    email: attendee.email || booking.responses?.email?.value || '',
    phone: attendee.phoneNumber || booking.responses?.attendeePhoneNumber?.value || '',
    problem: booking.responses?.['problem-statement']?.value || 'Not specified',

    // Additional form responses
    lead_source: booking.responses?.['lead-location']?.value || '',
    yt_video: booking.responses?.['yt-video']?.value || '',
    business_website: booking.responses?.['business-website']?.value || '',
    location: booking.responses?.['location-lead']?.value || '',

    // Call timing
    call_datetime: callDatetime.toISOString(),
    call_datetime_formatted: callDatetime.toLocaleString('en-US', {
      weekday: 'long',
      month: 'short',
      day: 'numeric',
      hour: 'numeric',
      minute: '2-digit',
      timeZoneName: 'short'
    }),
    call_time: callDatetime.toLocaleTimeString('en-US', {
      hour: 'numeric',
      minute: '2-digit',
      timeZoneName: 'short'
    }),
    call_day: callDatetime.toLocaleDateString('en-US', { weekday: 'long' }),

    // Meeting link
    meeting_link: booking.metadata?.videoCallUrl || booking.location || '[MEETING_LINK]',

    // For scheduling logic
    hours_until_call: Math.floor((callDatetime - new Date()) / (1000 * 60 * 60)),

    // Initial stage
    stage: 'booked'
  }
}];

