// =============================================
// CHECK WHICH PRE-CALL EMAILS TO SEND
// =============================================
// This runs every 15 minutes and checks each
// 'booked' lead to see if it's time to send
// any of the pre-call emails.
// =============================================

const leads = $input.all();
const now = new Date();
const emailsToSend = [];

for (const item of leads) {
  const lead = item.json;
  const callTime = new Date(lead['Call Time']);
  const hoursUntilCall = (callTime - now) / (1000 * 60 * 60);

  // Skip if call is in the past
  if (hoursUntilCall < 0) continue;

  // EMAIL 2: Testimonials (24 hours before)
  // Send if between 23.5 and 24.5 hours before call
  if (hoursUntilCall >= 23.5 && hoursUntilCall <= 24.5) {
    emailsToSend.push({
      ...lead,
      email_to_send: 2,
      email_name: 'Testimonials (24 hrs before)'
    });
  }

  // EMAIL 3: Reminder + Question (4 hours before)
  // Send if between 3.5 and 4.5 hours before call
  if (hoursUntilCall >= 3.5 && hoursUntilCall <= 4.5) {
    emailsToSend.push({
      ...lead,
      email_to_send: 3,
      email_name: 'Reminder + Question (4 hrs before)'
    });
  }

  // EMAIL 4: Final Reminder (30 min before)
  // Send if between 25 and 35 minutes before call
  if (hoursUntilCall >= 0.4 && hoursUntilCall <= 0.6) {
    emailsToSend.push({
      ...lead,
      email_to_send: 4,
      email_name: 'Final Reminder (30 min before)'
    });
  }
}

// If no emails to send, return empty flag
if (emailsToSend.length === 0) {
  return [{ json: { no_emails: true } }];
}

return emailsToSend.map(e => ({ json: e }));

// =============================================
// PARSE FATHOM CALL DATA
// =============================================
// Extracts the call summary and attendee info
// from Fathom's webhook payload.
// =============================================

const payload = $input.first().json;

return [{
  json: {
    // Find lead by this email
    attendee_email: payload.attendee_email || payload.participants?.[0]?.email || '',

    // Call summary from Fathom AI
    call_summary: payload.summary || payload.tldr || 'Call completed. Summary not available.',

    // Action items if available
    action_items: payload.action_items || payload.next_steps || [],

    // For email copy
    call_date: new Date().toLocaleDateString('en-US', { month: 'short', day: 'numeric' })
  }
}];

// =============================================
// FIND LEAD BY EMAIL
// =============================================
// Matches the Fathom attendee email to our Sheet
// =============================================

const fathomData = $('Parse Fathom Data').first().json;
const leads = $('Get All Leads (Post-Call)').all();

const targetEmail = fathomData.attendee_email.toLowerCase();
const matchedLead = leads.find(l => 
  l.json.Email?.toLowerCase() === targetEmail
);

if (!matchedLead) {
  return [{ json: { error: 'Lead not found', email: targetEmail } }];
}

return [{
  json: {
    ...matchedLead.json,
    call_summary: fathomData.call_summary,
    call_date: fathomData.call_date
  }
}];

